import * as React from "react";

// อย่าลืม import ฟอนต์ใน global css หรือ _app.js ด้วยนะครับ
// ตัวอย่างนี้ใช้ /fonts/ หรือ Google Fonts ก็ได้

export default function BioBox2FuneralPoster({
  profile,        // URL รูปภาพ (string)
  poster_name,    // ข้อความ ชื่อ
  word,           // ข้อความวรรคทอง (รองรับ \n)
  living,         // ช่วงปี
  patternImgUrl,  // URL pattern ด้านล่าง (optional)
  className,
  style,
}) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width={1080}
      height={1920}
      fill="none"
      viewBox="0 0 1080 1920"
      className={className}
      style={style}
    >
      {/* BG */}
      <rect width="1080" height="1920" fill="#F5F5F5" />
      <g clipPath="url(#a)">
        <rect width="1080" height="1920" fill="#fff" />

        {/* พื้นที่วางรูปโปรไฟล์ */}
        <g>
          <rect x={11} y={0} width={1080} height={1131} fill="#C1C1C1" />
          {/* รูปโปรไฟล์ */}
          {profile && (
            <image
              href={profile}
              x={11}
              y={0}
              width={1080}
              height={1131}
              preserveAspectRatio="xMidYMid slice"
              style={{ clipPath: "url(#profileClip)" }}
            />
          )}
        </g>

        {/* กราฟิกซ้อนทับขาวแบบเดิม */}
        <g>
          <rect width={1080} height={519} transform="translate(11 612)" fill="url(#b)" />
        </g>

        {/* ชื่อ */}
        <text
          xmlSpace="preserve"
          fill="#000"
          fontFamily="Charmonman"
          fontSize={64}
          letterSpacing="0em"
          style={{ whiteSpace: "pre" }}
        >
          <tspan x={460.531} y={1323}>
            {poster_name || "ชื่อผู้วายชนม์"}
          </tspan>
        </text>

        {/* ปี/ข้อความช่วงอายุ */}
        <text
          xmlSpace="preserve"
          fill="#000"
          fontFamily="Garet"
          fontSize={36}
          fontWeight={300}
          letterSpacing=".1em"
          style={{ whiteSpace: "pre" }}
        >
          <tspan x={394.794} y={1403.42}>
            {living || "2500 – 2567"}
          </tspan>
        </text>

        {/* วรรคทอง/wording รองรับขึ้นบรรทัดใหม่ */}
        <text
          xmlSpace="preserve"
          fill="#000"
          fontFamily="Garet"
          fontSize={40}
          fontWeight={300}
          letterSpacing=".05em"
          style={{ whiteSpace: "pre" }}
        >
          {(word || "วรรคทอง/wording").split("\n").map((line, idx) => (
            <tspan x={433.82} y={1566.8 + idx * 45} key={idx}>
              {line}
            </tspan>
          ))}
        </text>

        {/* Static: "ในความทรงจำของเรา" */}
        <text
          xmlSpace="preserve"
          fill="#000"
          fontFamily="Garet"
          fontSize={40}
          fontWeight={300}
          letterSpacing=".1em"
          style={{ whiteSpace: "pre" }}
        >
          <tspan x={337.309} y={1185.8}>
            {"ในความทรงจำของเรา"}
          </tspan>
        </text>

        {/* pattern ด้านล่าง */}
        <rect
          x={11}
          y={1682}
          width={1069}
          height={265}
          fill="url(#c)"
        />
      </g>
      <defs>
        <clipPath id="a">
          <rect width="1080" height="1920" fill="#fff" />
        </clipPath>
        {/* สำหรับ crop รูป (ถ้าต้องการใช้ clipPath กับ <image>) */}
        <clipPath id="profileClip">
          <rect x="11" y="0" width="1080" height="1131" />
        </clipPath>
        <linearGradient
          id="b"
          x1={540}
          x2={540}
          y1={519}
          y2={0}
          gradientUnits="userSpaceOnUse"
        >
          <stop offset={0.063} stopColor="#fff" />
          <stop offset={1} stopColor="#fff" stopOpacity={0} />
        </linearGradient>
        {/* pattern image ด้านล่าง */}
        <pattern
          id="c"
          width={1}
          height={1}
          patternContentUnits="objectBoundingBox"
        >
          <image
            id="pattern-image"
            href={patternImgUrl || "/images/pattern.png"}
            width={1069}
            height={265}
            preserveAspectRatio="none"
          />
        </pattern>
      <image
        xlinkHref="data:image/png;base64,"
        id="d"
        width={1069}
        height={265}
        data-name="Twitter post - 1.png"
        preserveAspectRatio="none"
      />
    </defs>
  </svg>
  );
}